-- ===============================
-- EXECUTE
-- ===============================
local function executeScript()
    if UserInputService.TouchEnabled then
        loadstring(HyperShotMobiles_SOURCE)()
    else
        loadstring(HypershotPc_SOURCE)()
    end
end

executeScript()

-- ===============================
-- TELEPORT QUEUE
-- ===============================
LocalPlayer.OnTeleport:Connect(function()
    if not TeleportCheck and queueTeleport then
        TeleportCheck = true

        if UserInputService.TouchEnabled then
            queueTeleport("loadstring([==[" .. HyperShotMobiles_SOURCE .. "]===])()")
        else
            queueTeleport("loadstring([==[" .. HypershotPc_SOURCE .. "]===])()")
        end
    end
end)

-- ===============================
-- TELEPORT FAIL SAFE
-- ===============================
TeleportService.TeleportInitFailed:Connect(function(player)
    if player == LocalPlayer and queueTeleport then
        if UserInputService.TouchEnabled then
            queueTeleport("loadstring([==[" .. HyperShotMobiles_SOURCE .. "]===])()")
        else
            queueTeleport("loadstring([==[" .. HypershotPc_SOURCE .. "]===])()")
        end
    end
end)
